import React, { useState } from 'react';
import { TextField, Button, Typography, Paper } from '@mui/material';

const Star = () => {
  const [celebrityName, setCelebrityName] = useState('');
  const [dietPlan, setDietPlan] = useState('');
  const [exercises, setExercises] = useState('');

  const handleFetchData = () => {
  
    const mockDietPlan = 'Sample Diet Plan: Eat healthy and stay hydrated.';
    const mockExercises = 'Sample Exercises: Yoga, running, and weight lifting.';

    setDietPlan(mockDietPlan);
    setExercises(mockExercises);
  };

  return (
    <div>
      <Typography variant="h4" gutterBottom>
        Celebrity Diet and Exercises
      </Typography>
      <TextField
        label="Enter Celebrity Name"
        variant="outlined"
        fullWidth
        value={celebrityName}
        onChange={(e) => setCelebrityName(e.target.value)}
      />
      <Button
        variant="contained"
        color="primary"
        onClick={handleFetchData}
        style={{ marginTop: '10px' }}
      >
        Fetch Diet and Exercises
      </Button>
      {dietPlan && exercises && (
        <Paper elevation={3} style={{ padding: '20px', marginTop: '20px' }}>
          <Typography variant="h6">Diet Plan:</Typography>
          <Typography>{dietPlan}</Typography>
          <Typography variant="h6" style={{ marginTop: '10px' }}>
            Exercises:
          </Typography>
          <Typography>{exercises}</Typography>
        </Paper>
      )}
    </div>
  );
};

export default Star;
